import React from "react";

const Test = () => {
  let weatherData = {
    temperature: 5,
    location: "London",
  };

  return (
    <div>
      <p>
        The temperature in {weatherData.location} is {weatherData.temperature}
      </p>
      <button>Click me</button>
    </div>
  );
};

export default Test;
